  let i = 1;
  return (
    <div className="wrapper1">
      {console.log(value)}
      <div className="wrapper2">
        {properties.map((index) => {
          if (i <= 4) {
            return <div className="wrapper3" key={index._id}></div>;
            {
              {
                i = i + 1;
              }
            }
          } else {
            {
              changevalue(value + 1);
            }
          }
        })}
      </div>
    </div>
  );
};
export default Content;
